import React from 'react';
import { 
  AreaChart, Area, XAxis, YAxis, CartesianGrid, 
  Tooltip, ResponsiveContainer, ReferenceLine, ReferenceDot, Label 
} from 'recharts';

const SunIcon = ({ x, y, type }) => {
  const iconUrl = type === 'sunrise' 
    ? "https://cdn.weatherapi.com/weather/64x64/day/113.png" 
    : "https://cdn.weatherapi.com/weather/64x64/night/113.png";
  return (
    <g>
      <circle cx={x} cy={y + 15} r="18" fill="rgba(0,0,0,0.3)" filter="blur(3px)" />
      <svg x={x - 17} y={y} width="34" height="34"><image href={iconUrl} width="100%" height="100%" /></svg>
    </g>
  );
};

const WeatherChart = ({ data, sunrise, sunset }) => {
  const now = new Date();
  const currentFullTime = `${now.getFullYear()}-${(now.getMonth()+1).toString().padStart(2, '0')}-${now.getDate().toString().padStart(2, '0')} ${now.getHours().toString().padStart(2, '0')}:00`;
  const currentDataPoint = data.find(d => d.fullTime === currentFullTime);

  const formatAstroTime = (timeStr) => {
    if (!timeStr) return null;
    const [time, modifier] = timeStr.split(' ');
    let [hours] = time.split(':');
    if (hours === '12') hours = '00';
    if (modifier === 'PM') hours = parseInt(hours, 10) + 12;
    const target = `${new Date().toISOString().split('T')[0]} ${hours.toString().padStart(2, '0')}:00`;
    return data.some(d => d.fullTime === target) ? target : null;
  };

  return (
    <div className="glass-panel" style={{ height: '400px', width: '100%', padding: '20px', borderRadius: '15px', background: 'rgba(255,255,255,0.05)' }}>
      <ResponsiveContainer width="100%" height="100%">
        <AreaChart data={data} margin={{ top: 60, right: 20, left: -20, bottom: 20 }}>
          <defs>
            <linearGradient id="colorTemp" x1="0" y1="0" x2="0" y2="1">
              <stop offset="5%" stopColor="#8884d8" stopOpacity={0.8}/><stop offset="95%" stopColor="#8884d8" stopOpacity={0.1}/>
            </linearGradient>
          </defs>
          <CartesianGrid strokeDasharray="3 3" vertical={false} stroke="rgba(255,255,255,0.1)" />
          <XAxis dataKey="fullTime" tickFormatter={(str) => str.split(' ')[1]} stroke="rgba(255,255,255,0.5)" fontSize={10} interval={0} minTickGap={10} />
          <YAxis stroke="rgba(255,255,255,0.5)" fontSize={12} tickFormatter={(val) => `${val}°`} domain={['dataMin - 3', 'dataMax + 3']} />
          
          <ReferenceLine x={formatAstroTime(sunrise)} stroke="#ffd700" strokeDasharray="5 5"><Label content={<SunIcon type="sunrise" y={-15} />} /></ReferenceLine>
          <ReferenceLine x={formatAstroTime(sunset)} stroke="#ff4500" strokeDasharray="5 5"><Label content={<SunIcon type="sunset" y={-15} />} /></ReferenceLine>
          
          {currentDataPoint && (
            <ReferenceLine x={currentFullTime} stroke="#00f2ff" strokeWidth={2} strokeDasharray="3 3">
              <Label value="TERAZ" position="top" fill="#00f2ff" fontSize={12} offset={20} />
            </ReferenceLine>
          )}

          <Tooltip contentStyle={{ backgroundColor: '#1a1a1a', border: 'none', borderRadius: '10px' }} />
          <Area type="monotone" dataKey="temp" stroke="#8884d8" strokeWidth={4} fill="url(#colorTemp)" isAnimationActive={false} />
          {currentDataPoint && <ReferenceDot x={currentFullTime} y={currentDataPoint.temp} r={6} fill="#00f2ff" stroke="#fff" />}
        </AreaChart>
      </ResponsiveContainer>
    </div>
  );
};

export default WeatherChart;
